- !ruby/object:ThesaurusConcept
  identifier: C28252
  notation: kg
  synonym: Kilogram
  definition: The basic SI unit of mass. It is defined as the mass of an international
    prototype in the form of a platinum-iridium cylinder kept at Sevres in France.
    It is the only basic unit still defined in terms of a material object, and also
    the only one with a prefix [kilo] already in place. A kilogram is equal to 1,000
    grams and 2.204 622 6 pounds. (NCI)
  preferredTerm: Kilogram
