- !ruby/object:ThesaurusConcept
  identifier: C44277
  notation: F
  synonym: Degree Fahrenheit
  definition: The Fahrenheit temperature scale is named after the German physicist
    Gabriel Fahrenheit (1686-1736), who proposed it in 1724. In this scale, the freezing
    point of water is 32 degrees Fahrenheit and the boiling point is 212 degrees,
    placing the boiling and melting points of water 180 degrees apart. In this scale
    a degree Fahrenheit is 5/9ths of a Kelvin (or of a degree Celsius), and minus
    40 degrees Fahrenheit is equal to minus 40 degrees Celsius. (NCI)
  preferredTerm: Degree Fahrenheit
  topLevel: false
  parentIdentifier: C66770
